css:
@-moz-document domain("www.nitrotype.com")
{
body {
    background: none;
}
html {
    background: fixed url(https://media.discordapp.net/attachments/888602438532227123/901993459454464020/nitro_type_theme.png?width=887&height=499), #001d45;
    background-size: 100%
}
.card--grit {
    background: none;
}
.bg--gradient {
    background: fixed;
}
.theme--pDefault .profile-bg {
    background: url("https://media.discordapp.net/attachments/888602438532227123/902049086788743188/Untitled_10.png?width=887&height=499") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #fff 100%);
    color: #111;
    background-size: 100%
}
.theme--pDefault .profile-bgHead {
    background: url("https://media.discordapp.net/attachments/888602438532227123/902049086788743188/Untitled_10.png?width=887&height=499") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
}
.theme--pDefault.is-gold .profile-bg {
    background: url("https://media.discordapp.net/attachments/888602438532227123/902049086788743188/Untitled_10.png?width=887&height=499") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
}
.card--a {
    background-color: #fff0;
    color: #fff;
}
}
